INSERT INTO `artikel` (`id`, `judul`, `isi`, `penulis`, `kategori`, `gambar`, `tanggal`) VALUES
(1, 'Membuat Favicon Website', '<p>\r\n	Favicon merupakan sebuah icon yang berada di samping alamat website, tab browser, dan bookmark. Ukuran icon sangat kecil yaitu 16x16 pixels. Yang anda butuhkan untuk membuatnya hanyalah file berextensi *.ico. Untuk membuat file berekstensi <span style="color: rgb(255, 0, 0);">*.ico</span> anda bisa langsung membuatnya dengan menggunkan software gratisan Junior Icon Editor, atau anda bisa membuatnya dengan tools gratis faforit anda Favicon merupakan sebuah icon yang berada di samping alamat website, tab browser, dan bookmark. Ukuran icon sangat kecil yaitu 16x16 pixels. Yang anda butuhkan untuk membuatnya hanyalah file berextensi *.ico. Untuk membuat file berekstensi *.ico anda bisa langsung membuatnya dengan menggunkan software gratisan Junior Icon Editor, atau anda bisa membuatnya dengan tools gratis faforit anda</p>\r\n', 'Admin', 'Tutorial', 'baner_06.jpg', '24.05.2011'),
(2, 'Download Adobe Flash ActiveX versi 10.1.85.3', '<p>\r\n	Salam Sahabat Garuda Media !!! Kami menerima laporan bahwa ada beberapa komputer/laptop tidak bisa menjalankan CD Garuda Media. Setelah Kami pelajari, ternyata kebanyakan dialami oleh komputer yang sudah diisntall adobe flash CS5, maupun pengguna windows 7 Hal ini disebabkan karena Adobe Flash ActiveX yang disertakan dalam CD totorial tersebut masih kalah</p>\r\n', 'Admin', '', 'baner_07.jpg', '12.04.2011'),
(3, 'Pengumuman Hasil Tryout Persiapan Seleksi CPNS 28 November 2010', '<p>\r\n	Garuda Media mengadakan tryout tes seleksi CPNS 2010, pada tanggal 28 November 2010 Tryout ujian seleksi CPNS 2010 ini merupakan event kedua yang diselenggarakan oleh Garudamedia bekerjasama dengan karismaacademy yang lebih berpengalaman dibidang event organizer pelatihan pengembangan SDM dan pelatihan teknologi informasi untuk instansi dan perusahaan. Meskipun jumlah pesertanya tidak terlalu banyak namun kami telah mencoba berusaha optimal &amp;</p>\r\n', 'Admin', '', 'baner_08.jpg', '12.04.2011'),
(4, 'Contoh Website Tutorial Web Programming', '<p>\r\n	Berhubung untuk website demo tutorial web programming di www.garudanews.co.cc berikut ini untuk demo tutorial kami pindah ke karismakomputer.com/garudanews</p>\r\n', 'Admin', '', 'baner_09.jpg', '12.04.2011');
INSERT INTO `cd` (`id`, `judul`, `deskripsi`, `kode_produk`, `total_durasi`, `jumlah_tutorial`, `harga`, `pemateri`, `cover`) VALUES
(1, 'CD Tutorial 3D Studio Max - Mahir Membuat Objek 3 Dimensi, Efek, Pengaturan Cahaya dan Animasi', '<p style="float:left;">Biaya Pengiriman : A<br />Dalam CD Tutorial ini Anda akan dipandu dalam menggunakan Autodesk 3D Max dari awal, Yaitu mengoperasikan tools yang ada hingga mahirmenggunakan perangkat lunak3DS Max dengan cepat.Terdapat juga beberapa latihan yaitu membuat komposisi objek, memberikan dan mengatur modifikasi objek, memberikan kesan permukaan atau tekstur, teknik pencahayaan serta efek \r\ncahaya, efek hujan, dengan partikel, Animasi objek, dan terakhir adalah teknik rendering untuk menghasilkan file gambar atau film.<br />ISI TaUTORIAL :<br /></p><ul style="padding-left:30px;float:left;"><li>Membahas interface serta tool terbaru3D Studio Max 2010 + membuat modifikasi objek</li>\r\n<li>Modeling dan Edit Poly + menggunakan shape + mengatur cahaya dan efek pencahayaan</li><li>Menerapkan efek testur dan material pada objek + memberi efek partikel dan suasana</li>\r\n<li>Membuat Animasi + Rendering</li>\r\n</ul><br /><br />', 'GM-008', 6, 62, 55000, 'Dody Priyatmono', '3ds-max-2010.jpg');
