(141, 'GM-15', '', 'CD INTERAKTIF Sukses Tes Kerja merupakan sajian multimedia pertama dan satu-satunya di Indonesia yang membahas dan menjawab permasalah seputar proses melamar kerja. Kiat-kiat & tips-trik mengerjakan berbagai macam bentuk soal yang akan dihadapi para pelamar kerja.'),
(142, 'GM-15', '', 'Pembahasan dimulai dari presentasi seputar alur dan sistem perekrutan kerja di perusahaann. Mulai dari membuat surat lamaran kerja, CV, bentuk-bentuk tes psikotest beserta pembahasannya, wawancara hingga penandatangan kontrak kerja. Sangat bermanfaat bagi siapa saja yang ingin mempersipakan diri menghadapi tes kerja yang dilakukan perusahaan BUMN, TES CPNS, Bank maupun perusahaan swasta.'),
(143, 'GM-15', 'PEMBAHASAN MATERI SEBAGIAN BESAR DISAMPAIKAN DALAM FORMAT VIDEO PRESENTASI MULTIMEDIA SECARA LIVE! ', ''),
(144, 'GM-15', 'DILENGKAPI DENGAN SOFTWARE SIMULASI TES CPNS', 'Merupakan software simulasi mengerjakan soal CPNS, yang memilik fitur multimedia interaktif. Terdiri dari kumpulan soal prediksi CPNS, lembar jawaban interaktif yang memiliki kemampuan mengkoreksi serta mengukur score & passing grade secara instan, lengkap dengan timer tes dan fitur menghafal jawaban & soal khusus untuk menghadapi tes pengetahuan umum CPNS\r\n'),
(145, 'GM-15', 'ISI CD', 'Video Presentasi Kiat Melamar Kerja'),
