(192, 'GM-21', 'BAB 8 PEMODELAN JEMBATAN ', 'Pemodelan jembatan balok, Penampang jembatan balok, Offset \r\nbalok jembatan, Beban berjalan jembatan balok, Output analisis \r\njembatan balok, Pemodelan jembatan rangka baja, Disain baja \r\njembatan, Pemodelan deck jembatan kabel, Pemodelan kabel \r\njembatan, Penentuan penampang jembatan kabel, Analisa jembatan \r\nkabel.'),
(193, 'GM-22', '1. 2D COMPOSITING', 'Pada latihan pertama ini \r\npengguna akan belajar \r\nmembuat project mulai dari \r\nmengimport file-file yang \r\ndibutuhkan kemudian menata \r\ndalam layer dan \r\nmenganimasikan posisi, rotasi \r\ndan skala objek. Terakhir \r\ndiajarkan bagaimana \r\nmemproduksi sebuah file \r\nmovie hasil dari kompositing \r\npertama.'),
(194, 'GM-22', '2. BUNGA MEKAR', 'Compositing kedua saya beri \r\njudul bunga mekar, karena \r\ndisini pengguna diajak \r\nmenggunakan layer tiga \r\ndimensi dan membuat sebuah \r\nscene pemandangan dengan \r\nbunga yang sedang mekar. \r\nAdapun beberap fasilitas yang \r\nakan ditemui dalam BAB ini \r\nantara lain; orientasi layer, \r\nmembuat kamera, \r\nmengaplikasikan lens effect \r\npro, masking layer, efek depth \r\nof field pada kamera, dll.\r\n'),
(195, 'GM-22', '3. RUMAH KOSONG', 'Dalam kasus kali ini kita belajar \r\nmembuat 3D kompositing \r\ndengan 3D layer. Dalam proses \r\nini kita akan mengolah layer \r\ndengan cara diputar sehingga \r\nmembentuk sebuah objek, \r\ndalam hal ini kita buat \r\nberbentuk tangga.'),
(196, 'GM-22', ' 4. GREEN SCREEN', 'Teknik green screen atau blue \r\nscreen adalah teknik yang \r\nsangat populer dalam dunia \r\nspesial efek. banyak film \r\nmenggunakan teknik ini untuk \r\nmenggabungkan gambar nyata \r\ndengan rekayasa komputer. Dan \r\nkali ini kita akan membahasanya \r\ndengan cara yang sangat \r\nsimple namun memberikan hasil \r\nyang maksimal.'),
(197, 'GM-22', ' 5. 3DS MAX DAN AFTER  EFFECT', 'MIX Motion graphic adalah \r\nteknik membuat objek diam \r\nmenjadi bergerak dan \r\nmenjadikannya sebuah \r\nkomposisi grafik yang \r\nmenawan serta dinamis saat di \r\ngerakkan. Anda bahkan setiap \r\nhari melihat motion graphic di \r\ntelevisi. cara yang digunakan \r\nuntuk membuat motion graphic \r\nbiasanya\r\ndengan menggunakan \r\nbeberapa metode gabungan, \r\nseperti penggabungan teknik \r\nanimasi, live shot dengan grafik \r\ngerak di after effect. Nah kali ini \r\nkita akan membahas teknik \r\npengabungan dari software 3ds \r\nmax dengan after effect untuk \r\nmembuat sebuah motion \r\ngraphic title yang keren.'),
