(204, 'GM-26', 'BAB 7 DESAIN GEDUNG ', 'Pemodelan dan penampang portal gedung, Offset dan tumpuan \r\nportal gedung, Beban angin pada gedung, Beban gempa UBC \r\npada gedung, Beban SNI, Kombinasi beban SNI, Parameter \r\ndisain beton, Output disain gedung STAAD v8i'),
(205, 'GM-26', 'BAB 8 PEMODELAN JEMBATAN ', 'Pemodelan jembatan balok, Penampang jembatan balok, Offset \r\nbalok jembatan, Beban berjalan jembatan balok, Output analisis \r\njembatan balok, Pemodelan jembatan rangka baja, Disain baja \r\njembatan, Pemodelan deck jembatan kabel, Pemodelan kabel \r\njembatan, Penentuan penampang jembatan kabel, Analisa jembatan \r\nkabel.'),
