(212, 'GM-24', 'BAB 1 PENDAHULUAN', 'Pengertian Manajemen Proyek, Kelebihan dari Microsoft roject, Membuka dan Mulai Program, Mengenal Menu dan Toolbar program Ms. Project.'),
(213, 'GM-24', 'BAB 2 PERENCANAAN & PERKIRAAN', 'Memulai Proyek Baru, Penetapan Jadwal Kerja, Memasukkan Uraian Pekerjaan & Durasi Pekerjaan.'),
(214, 'GM-24', 'BAB 3 PENJADUALAN PROYEK', 'Membuat Hubungan Antar Uraian Pekerjaan, Membuat Tampilan Lintasan Kritis, Membuat Tampilan Network Diagram, Tahapan Analisis PERT.'),
(215, 'GM-24', 'BAB 4 PENGORGANISASIAN SUMBER DAYA', 'Membuat Informasi Sumber Daya yang akan Digunakan, Memasukkan Sumber Daya Pada masing-Masing Uraian Pekerjaan, Proses Leveling Untuk Sumber Daya Berlebih (Over Alocation).'),
