(217, 'GM-24', ' BAB 6 PELAPORAN PROYEK', 'Pelaporan Teks Tradisional, Pelaporan Visual.'),
(218, 'GM-25', ' Bab-1 Object Oriented Programming (OOP) sekarang merupakan teknik yang wajib dikuasai oleh programmer - programmer.', 'Begitu juga dengan programmer PHP. Teknik ini menyediakan keunggulan dibandingkan dengan menggunakan teknik procedural.'),
(219, 'GM-25', 'Bab-2 PDO (Portable Data Object) memberikan kemudahan dalam  pengoperasia database dalam aplikasi website.', 'Keunggulan yang dibawa oleh PDO, developer tidak perlu khawatir tentang jenis database yang digunakan baik itu MySQL, postgre, sqlite dan lainnya. Karena perbedaan - perbedaan tersebut akan ditangani oleh PDO. Developer cukup menentukan driver dari database yang digunakan.'),
(220, 'GM-25', 'Bab-3 PHP Features Perkenalan dengan sejumlah fitur - fitur PHP.', 'Penggunaan error handler, pendalaman penggunaan fitur array, \r\nmengandalkan fitur - fitur native PHP dalam melakukan validasi untuk menghindari hal - hal yang tidak diinginkan terhadap website.'),
(221, 'GM-25', 'Bab-4 Aplikasi I', 'Anda akan diajak membuat aplikasi - aplikasi converter seperti converter video, converter ke excel, membuat SEO Friendly URL sehingga lebih bersahabat dengan search engine, integrasi website dengan Fitur - fitur Facebook dengan menggunakan API dan plugin - pluginya. Serta pembuatan module manajemen hak akses.'),
(222, 'GM-25', 'Bab-5 Aplikasi II', 'Ini kembali mencoba mengintegrasikan website dengan social media twitter dengan menggunakan widget dan APInya. Ditambah aplikasi menarik seperti pembuatan shopping cart dan metode pembayarannya dengan menggunakan paypal.'),
(223, 'GM-25', 'Bab-6 Mobile Website', 'Menggunakan jquery mobile dan \r\nmengintegrasikan dengan website utama. Berikut membuat pendeteksi sehingga ketika website diakses dari perangkat mobile secara otomatis diarahkan ke website versi mobile.'),
