INSERT INTO `materi_pelajaran` (`id`, `hak_akses`, `nama_pelajaran`, `kategori_tutorial`, `link`, `deskripsi`, `video`, `gambar`, `durasi`, `linkdownload`) VALUES
(275, 1, '06. Pembuatan Website Berita', 'php', '#Pembuatan-Website-Berita', 'Pembuatan website berita dengan mengintegrasikan modul-modul yang telah dibuat pada bab-bab sebelumnya, dilanjutkan dengan menguploadnya ke web server', '', 'GM10/6.png', '00:00:00', 'GM10-PHP.rar'),
(274, 1, '05. Aplikasi Website Bagian 2', 'php', '#Aplikasi-Website-Bagian-2', 'Pembuatan aplikasi dengan PHP seperti Polling, tell Friends, image gallery dengan efek lightbox & reflection, dan navigasi dengan sistem pagination', '', 'GM10/5.png', '00:00:00', 'GM10-PHP.rar'),
(271, 1, '02. Fungsi Built In PHP', 'php', '#Fungsi-Built-In-PHP', 'belajar mengetahui penggunaan fungsi - fungsi/fitur built in pada PHP, diakhiri dengan pembuatan aplikasi login system, secure Upload file dan Hit Counter', '', 'GM10/2.png', '00:00:00', 'GM10-PHP.rar'),
(272, 1, '03. Datetime, Database, & Operasi String', 'php', '#Datetime-Database-dan-Operasi-String', 'pengenalan penggunaan datetime, operasi string, dan database. dilengkapi aplikasi registrasi aktivasi user, dan login recovery password dengan database', '', 'GM10/3.png', '00:00:00', 'GM10-PHP.rar'),
(273, 1, '04. Aplikasi Website Bagian 1', 'php', '#Aplikasi-Website-Bagian-1', 'belajar untuk memahami dan membuat aplikasi dengan PHP seperti polling, tell friends, image gallery dengan efek lightbox & reflection dan navigasi dengan sistem pagination', '', 'GM10/4.png', '00:00:00', 'GM10-PHP.rar'),
(260, 1, '02. Membuat dan Menata Objek', '3dstudiomax', '#Membuat-dan-Menata-Objek', 'Belajar membuat object standart, object extended, menggunakan fasilitas auto grid', '', 'GM08/2.jpg', '00:00:00', 'GM08-3DSTUDIOMAX.rar'),
(261, 1, '03. Pengaturan dan Alat Alat (Tools)', '3dstudiomax', '#Pengaturan-dan-Alat-Alat', 'Mengatur unit setup, mengcopy/clone object, mirror, align, unit setup, select by name, select sets & membuat aplikasi dari \r\n\r\nbeberapa fasilitas tools, Latihan manata objek', '', 'GM08/3.jpg', '00:00:00', 'GM08-3DSTUDIOMAX.rar'),
(262, 1, '04. Modifikasi', '3dstudiomax', '#Modifikasi', 'Memberi nama object, mengganti warna object, mengganti parameter object, modifier list & configure modifier sets, latihan \r\n\r\nmembuat tangga', '', 'GM08/4.jpg', '00:00:00', 'GM08-3DSTUDIOMAX.rar'),
(263, 1, '05. Modeling dan Edit Poly', '3dstudiomax', '#Modeling-dan-Edit-Poly', 'Memberi modifikasi edit poly, seleksi vertex, edge, border, polygon, dan element, menggunakan seleksi Polygon dan edge, \r\n\r\nlatihan membuat bangunan sederhana', '', 'GM08/5.jpg', '00:00:00', 'GM08-3DSTUDIOMAX.rar'),
(264, 1, '06. Bermain Dengan Shape', '3dstudiomax', '#Bermain-Dengan-Shape', 'Membuat object menggunakan shape: Line, circle, arc, dll, modifikasi extrude, bevel, bevel profile, Modifikasi Lathe Loft \r\n\r\nobjek, latihan membuat Pasta Gigi', '', 'GM08/6.jpg', '00:00:00', 'GM08-3DSTUDIOMAX.rar'),
(265, 1, '07. Cahaya dan Efek Pencahayaan', '3dstudiomax', '#Cahaya-dan-Efek-Pencahayaan', 'Sumber-sumber cahaya (Omni, Spot, Direct dan Skylight), parameter sumber cahaya Efek cahaya/Lens Effect; Glow dan ray Latihan \r\n\r\npencahayaan', '', 'GM08/7.jpg', '00:00:00', 'GM08-3DSTUDIOMAX.rar'),
