(155, 1, '05. Manipulasi Object', 'autocad', '#manipulasiobject', 'Objek-objek dalam AutoCAD dapat dimanipulasi dengan menggunakan perintah-perintah offset, mirror, trim, extend, fillet, dan chamfer. Pemahaman atas perintah tersebut sangat penting untuk dapat meningkatkan level kemampuan<br />\r\n01. Offest, 02. mirror, 03. trim cutting edges, 04. trim edges extend, 05. extend, 06. fillet, 07. chamfer', '', 'GM01/5.jpg', '00:00:00', 'GM01-AutoCAD.rar'),
(156, 1, '06. Aneka Perintah Lain', 'autocad', '#anekalerintahlain', 'Hatch, Polygon Tool, Boundary, layer dan Table.', '', 'GM01/5.jpg', '00:00:00', 'GM01-AutoCAD.rar'),
(154, 1, '04. Modifikasi Object', 'autocad', '#modifikasiobject', 'Berlatih menggunakan perintah-perintah modifikasi object yang sangat sering digunakan saat bekerja dengan menggunakan AutoCAD, yaitu perintah move, copy, rotate, mengubah ukuran, stretch, scale, align, array rectangular, serta polar array.<br />\r\n01. perintah move, 02. copy & paste, 03. merubah ukuran dan stretch, 04. scale, 05. align, 06. array rectangular, 07. polar array.', '', 'GM01/4.jpg', '00:00:00', 'GM01-AutoCAD.rar'),
(153, 1, '03. Mempercepat Penggambaran', 'autocad', '#mempercepatpenggambaran', 'Mempelajari teknik-teknik untuk membantu mempercepat proses penggambaran, yaitu menggunakan polar tracking, object snap, object snap tracking, serta berlatih menggambar menggunakan sumbu polar koordinat.<br />\r\n01. menggunakan polar tracking, 02. fasilitas object snap, 03. object snap tracking, 04. latihan polar koordinat.\r\n', '', 'GM01/3.jpg', '00:00:00', 'GM01-AutoCAD.rar'),
(152, 1, '02. Teknik Dasar Menggambar', 'autocad', '#teknikdasarmenggambar', 'Mengetahui dasar-dasar sistem koordinat absolute dan sistem koordinat relative yang digunakan dalam penentuan posisi titik di AutoCAd, berlatih untuk menggambar persegi, menggambar lingkaran, dan menggunakan perintah Arc (busur)', '', 'GM01/2.jpg', '00:00:00', 'GM01-AutoCAD.rar'),
(160, 1, '10. Denah Bangunan', 'autocad', '#denahbangunan', 'Berlatih menggambar bangunan', '', 'GM01/9.jpg', '00:00:00', 'GM01-AutoCAD.rar'),
(151, 1, '01. Introduction', 'autocad', '#seputarautocad', 'Perkenalan singkat mengenai software AutoCAD, mempelajari beberapa teknik menggambar garis, mengatur tampilan, memilih gambar, serta cara mengubah tampilan AutoCAD\r\n<br />\r\n01. mengenal autocad, 02. navigasi autocad 2009, 03. membuka dan menyimpan data, 04. menggambar garus, 05. mengatur tampilan dan memilih gambar, 06. memilih display.', '', 'GM01/1.jpg', '00:00:00', 'GM01-AutoCAD.rar'),
(161, 1, '11. Tampak Bangunan', 'autocad', '#tampakbangunan', 'menggambar tampak depan bangunan.\r\n', '', 'GM01/10.jpg', '00:00:00', 'GM01-AutoCAD.rar'),
(162, 1, '12. Plot & Layout Cetak', 'autocad', '#plotlayoutcetak', 'teknik mencetak dan mengatur layout.', '', 'GM01/12.jpg', '00:00:00', 'GM01-AutoCAD.rar'),
(276, 1, '01. Pengenalan Inventor Sketsa 2D', 'autodesk', '#Pengenalan-Inventor-Sketsa-2D', 'pengenalan lembar kerja inventor dan pembuatan sketsa 2D menggunakan 2D sketched panel', '', 'GM11/1.jpg', '00:00:00', ''),
(277, 1, '02. Pengeditan 2D', 'autodesk', '#Pengeditan-2D', 'pengeditan sketsa 2D yang telah dibuat menggunakan 2D Sketch panel', '', 'GM11/2.jpg', '00:00:00', ''),
(278, 1, '03. Fitur Sketched', 'autodesk', '#Fitur-Sketched', 'pengenalan penggunaan extrude, revolve, rib, coil, & sweep untuk membuat object 3D', '', 'GM11/3.jpg', '00:00:00', ''),
(279, 1, '04. Fitur Placed Solid', 'autodesk', '#Fitur-Placed-Solid', 'pengenalan penggunaan thread, hole, sheel, fillery, chamfer untuk pengeditan 3D yang telah ada', '', 'GM11/4.jpg', '00:00:00', ''),
(280, 1, '05. Assembly Dari Semua Part', 'autodesk', '#Assembly-Dari-Semua-Part', 'pembuatan part-part serta pengassamblian dari semua part', '', 'GM11/5.jpg', '00:00:00', ''),
(281, 1, '06. Animasi Presentasi & Analisis Tegangan', 'autodesk', '#Animasi-Presentasi-dan-Analisis-Tegangan', 'pembuatan animasi dari pemasangan part-part pada saat di assembly dan menganalisis dari suatu part', '', 'GM11/6.jpg', '00:00:00', ''),
(282, 1, '07. Ploting', 'autodesk', '#Ploting', 'teknik mencetak/lpot desain gambar inventor pada layout lembar kerja', '', 'GM11/7.jpg', '00:00:00', ''),
(283, 1, '08. Desain Arm 3D', 'autodesk', '#Desain-Arm-3D', 'latihan membuat desain arm dari sketsa 2D hingga 3D', '', 'GM11/8.jpg', '00:00:00', ''),
(284, 1, '09. Desain Concord 3D', 'autodesk', '#Desain-Concord-3D', 'latihan membuat desain conrod dari sketsa 2D hingga 3D', '', 'GM11/9.jpg', '00:00:00', ''),
(285, 1, '10. Desain Fan 3D', 'autodesk', '#Desain-Fan-3D', 'latihan membuat desain fan dari sketsa 2D menjadi 3D', '', 'GM11/10.jpg', '00:00:00', ''),
(291, 1, '01. Introduction', 'autocad.2', '#pengenalanautocad2d3d', 'AutoCAD adalah salah satu software yang digunakan untuk menggambar teknik, misalnya untuk perancangan suatu arsitektur bangunan atau konstruksi (denah, tampak, potongan, dsb). Di Halaman ini kita akan berkenalan secara singkat mengenai AutoCAD, Mempelajari bagaimana membuat dokumen baru dan tool apa saja yang harus dipahami sebagai basic skill', '', 'GM13/1.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(292, 1, '02. Fitur draw', 'autocad.2', '#fiturdraw', 'disini anda akan mempelajari tool yang ada di Draw untuk membuat sketsa 2 Dimensi sebelum dijadikan 3 Dimensi', '', 'GM13/2.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(293, 1, '03. Fitur modify', 'autocad.2', '#fiturmodify', 'Mengenal Fungsi-fungsi tool yang ada di modify dan menggunakannya dalam pembuatan object AutoCAD 3 Dimensi', '', 'GM13/3.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(294, 1, '04. Fitur 3D modeling', 'autocad.2', '#fitur3dmodeling', 'Menggunakan tool-tool 3D, pemahanan tentang fungsi dan ketepatan penggunaan tool dalam pembuatan objek 3 Dimensi', '', 'GM13/4.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(295, 1, '05. Fitur solid editing', 'autocad.2', '#fitursolidediting', 'Solid editing adalah proses pengeditan objek 3 Dimensi, dimana kamu akan belajar memahami fungsi-fungsi khusus tool ini', '', 'GM13/5.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(296, 1, '06. Membuat Involute Gear', 'autocad.2', '#membuatinvolutegear', 'Untuk latihan kamu akan belajar membuat objek 3 Dimensi Involute Gear menggunakan tool yang sudah kamu pelajari di chapter sebelumnya. seperti tool Extrude, Filler, Circle, dll', '', 'GM13/6.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(297, 1, '07. Membuat Kepala Piston', 'autocad.2', '#membuatkepalapiston', 'membuat 3 Dimensi Kepala piston dengan menggunakan tool inti revolve tingkat kesulitan yang mudah', '', 'GM13/7.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(298, 1, '08. Membuat Rantai', 'autocad.2', '#membuatrantai', 'membuat rantai dengan tingkat ketelitian dalam pemasangan dan penggunaan tool yang sedang', '', 'GM13/8.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(299, 1, '09. Desain Furniture Sofa', 'autocad.2', '#desainfurnituresofa', 'Membuat desain funitur sofa lengkap dengan bantal sandaran dan bantal duduk dengan tambahan pencahayaan sinar matahari', '', 'GM13/9.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(300, 1, '10. Membuat Flens Mur& Baut', 'autocad.2', '#membuatflensmurbaut', 'membuat mur, flens dan baut, dimulai dari sketsa hingga pola pemasangan secara masal menggunakan array.', '', 'GM13/10.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(301, 1, '11. Desain Tangga Tralis', 'autocad.2', '#desaintanggatralis', 'mendesain tangga dengan tool khusus spline, mulai dari sketsa pembuatan tangga ( 2 Dimensi ) kemudian Extrude sampai finishing rendering tangga', '', 'GM13/11.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(302, 1, '12. Desain Rumah Minimalis', 'autocad.2', '#desainrumahminimalis', 'membuat rumah minimalis mulai dari awal hingga akhir dan membuat output file berupa gambar berekstensi sehingga bisa tampak visual detailnya', '', 'GM13/12.jpg', '00:00:00', 'GM13-AutoCADVol2.rar'),
(310, 1, '01. Warhol Pop Art', 'photoshop.vol4', '#WarholPopArt', '', '', 'GM12/1.jpg', '00:00:00', ''),
(311, 1, '02. Abstract Musician', 'photoshop.vol4', '#AbstractMusician', 'Membuat efek pada foto menjadi abstrak hitam putih', '', 'GM12/2.jpg', '00:00:00', ''),
(312, 1, '03. Floral Skin Main', 'photoshop.vol4', '#FloralSkinMain', 'Membuat siluet dari teks dengan tambahan floral ornamen', '', 'GM12/3.jpg', '00:00:00', ''),
(313, 1, '04. Text & Floral Art Siluet', 'photoshop.vol4', '#TextFloralArtSiluet', 'Mendesain sebuah foto dengan efek sehingga menjadi floral skin', '', 'GM12/4.jpg', '00:00:00', ''),
(315, 1, '05. True Color', 'photoshop.vol4', '#TrueColor', 'Mendesain suatu objek menjadi seperti poster true color', '', 'GM12/5.jpg', '00:00:00', ''),
(316, 1, '06. Smoke Art', 'photoshop.vol4', '#SmokeArt', 'Mengubah sebuah foto biasa dengan efek smoke art', '', 'GM12/6.jpg', '00:00:00', ''),
(317, 1, '07. Spectrum Lines Picture', 'photoshop.vol4', '#SpectrumLinesPicture', 'Menambahkan efek spectrum lines pada foto biasa', '', 'GM12/7.jpg', '00:00:00', ''),
(318, 1, '08. Grunge Line Art', 'photoshop.vol4', '#GrungeLineArt', 'Mengubah foto biasa menjadi grunge line art', '', 'GM12/8.jpg', '00:00:00', ''),
(319, 1, '09. Photo Text', 'photoshop.vol4', '#PhotoText', 'Mengubah foto biasa menjadi seakan-akan terbentuk karena banyak text art', '', 'GM12/9.jpg', '00:00:00', ''),
(320, 1, '10. Floral Text Art', 'photoshop.vol4', '#FloralTextArt', 'Memberi efek pada tulisan dengan efek floral text', '', 'GM12/10.jpg', '00:00:00', ''),
(321, 1, '11. Urban Style Pop Art', 'photoshop.vol4', '#UrbanStylePopArt', 'Menambahkan efek cahaya dan splatter pada foto', '', 'GM12/11.jpg', '00:00:00', ''),
(322, 1, '12. Pop Arts Ads Background', 'photoshop.vol4', '#PopArtsAdsBackground', 'Membuat pop art background untuk poster iklan', '', 'GM12/12.jpg', '00:00:00', ''),
(349, 1, '02. VB.NET Build In Features', 'vb.net', '#BuildInFeatures', '', '', 'GM16/2.jpg', '00:00:00', 'GM16-VB.NET.rar'),
