INSERT INTO `produk` (`id`, `kode_produk`, `nama_produk`, `deskripsi`, `harga`, `requirenment`, `jumlah_chapter`, `jumlah_sub_chapter`, `cover_image`, `image_detail`, `link_video_promo`, `image_overview1`, `image_overview2`, `image_overview3`, `image_overview4`, `katalog`) VALUES
(1, 'GM-01', 'AutoCAD', 'AUTOCAD adalah salah satu software CAD yang berfungsi untuk menggambar 2 Dimensi dan 3 Dimensi yang biasa digunakan oleh insinyur mesin, arsitek, sipil, desain interior dan lain-lain.', 50000, 'AutoCAD 2D, AutoCAD 3D', 12, 72, 'logo_produk_gm1.png', '1autocad.png', 'images/gambar_video_produk_detail.png', 'imgoverview/01 Autocad/1.jpg', 'imgoverview/01 Autocad/2.jpg', 'imgoverview/01 Autocad/3.jpg', 'imgoverview/01 Autocad/4.jpg', 'GM01 Autocad.pdf'),
(2, 'GM-02', 'Corel Draw', 'Berisi berbagai tutorial materi keterampilan & teknik-teknik populer dalam penggunaan CorelDraw sebagai software desain grafis yang sangat populer.', 50000, '-', 10, 57, 'produk_corel_draw.png', '2corel.png', '-', 'imgoverview/Corel.Draw/1.jpg', 'imgoverview/Corel.Draw/2.jpg', 'imgoverview/Corel.Draw/3.jpg', 'imgoverview/Corel.Draw/4.jpg', 'GM02 CorelDraw.pdf'),
(3, 'GM-03', 'Photoshop', 'CD ini mengungkap penggunaan teknik-teknik photoshop yang sering digunakan para praktisi profesional untuk membuat desain grafis, spesial efek, pop art, serta manipulasi foto sehingga didapatkan image hasil editing yang spektakuler.', 50000, '-', 10, 57, 'logo_produk_gm3.png', '3photoshop.png', '-', 'imgoverview/Photoshopv1/1.jpg', 'imgoverview/Photoshopv1/2.jpg', 'imgoverview/Photoshopv1/3.jpg', 'imgoverview/Photoshopv1/4.jpg', 'GM03 Photoshop Vol1.pdf'),
(4, 'GM-04', 'Microsoft Excel', 'Kehandalan Microsoft Excel dalam menyelesaikan berbagai tugas diurai dalam CD ini mulai dari tingkat dasar hingga lanjut dengan berbagai contoh kasus yang sering ditemui dalam aplikasi sehari-hari di bidang keuangan, administrasi database dan lain sebagainya.', 50000, '-', 10, 57, 'produk_ms_excel.png', '4excel.png', '-', 'imgoverview/Excel/1.jpg', 'imgoverview/Excel/2.jpg', 'imgoverview/Excel/3.jpg', 'imgoverview/Excel/4.jpg', 'GM04 Microsoft Excel.pdf'),
(5, 'GM-05', 'Photoshop Vol.2', 'Menggali fitur-fitur pada photoshop secara lebih detail dan mendalam, meliputi layer style, masking, brush, toning,  blending, seleksi, dan sebagainya, untuk kemudian dipadukan dalam aplikasi pembuatan art work yang mengagumkan.', 50000, '-', 10, 57, 'produk_photoshop_vol_4.png', '5photoshop.png', '-', 'imgoverview/Photoshopv2/1.jpg', 'imgoverview/Photoshopv2/2.jpg', 'imgoverview/Photoshopv2/3.jpg', 'imgoverview/Photoshopv2/4.jpg', 'GM05 Photoshop Vol2.pdf'),
(6, 'GM-06', 'Web Toko Online', 'Quick.Cart merupakan engine CMS yang didesain khusus untuk membuat toko online secara mudah, cepat, dan ringkas, serta telah dipercaya oleh para praktisi toko online di seluruh dunia.', 50000, '-', 10, 72, 'produk_web_toko_online.png', '6webtoko.png', '-', 'imgoverview/Web.Toko.online/1.jpg', 'imgoverview/Web.Toko.online/2.jpg', 'imgoverview/Web.Toko.online/3.jpg', 'imgoverview/Web.Toko.online/4.jpg', 'GM06 Web Toko.pdf'),
(7, 'GM-07', 'Adobe Flash', 'Mengenalkan interface tool serta fitur terbaru Flash CS4 dengan menggunakan contoh-contoh sederhana namun tetap menarik. Pembahasan meliputi cara menggambar artwork dalam Flash, membuat animasi dengan motion tween CS4 (motion tween baru).', 50000, '-', 10, 72, 'produk_flash.png', '7flash.png', '-', 'imgoverview/Flash/1.jpg', 'imgoverview/Flash/2.jpg', 'imgoverview/Flash/3.jpg', 'imgoverview/Flash/4.jpg', 'GM07 Flash Vol1.pdf'),
(8, 'GM-08', '3D STUDIO MAX', 'Dalam CD Tutorial ini anda akan dipandu dalam menggunakan Autodesk 3DS Max dari awal, yaitu mengoperasikan tools yang ada hingga mahir menggunakan perangkat lunak 3DS Maxs sebagai media animasi maupun modeling.', 55000, '-', 10, 57, 'produk_3D_studio_max.png', '93dsmax.png', '-', 'imgoverview/3Ds.Max/1.jpg', 'imgoverview/3Ds.Max/2.jpg', 'imgoverview/3Ds.Max/3.jpg', 'imgoverview/3Ds.Max/4.jpg', 'GM08 3ds Max.pdf'),
(10, 'GM-10', 'Web Programming', 'Web Programming dengan menggunakan PHP sangat populer dan mudah dipelajari. Situs – situs interaktif seperti Facebook, wikipedia, bahkan CMS wordpress pun menggunakan PHP. dengan CD ini anda akan belajar dari dasar hingga mahir.', 50000, '-', 10, 57, 'icon_produk_gm10.png', '10webprograming.png', '-', 'imgoverview/Web.Programing/1.jpg', 'imgoverview/Web.Programing/2.jpg', 'imgoverview/Web.Programing/3.jpg', 'imgoverview/Web.Programing/4.jpg', 'GM10 Web Programing.pdf'),
(9, 'GM-09', 'Photoshop Vol.3', 'CD Tutorial ini membahas penggunaan Tool dan Teknik Rahasia Photoshop, Praktek membuat karya seni digital secara lengkap dan siap pakai, membuat dan menggunakan ornament  fitur – fitur pendukung dalam membuat karya seni.', 50000, '-', 10, 72, 'produk_photoshop_digital.png', '8photoshop.png', '-', 'imgoverview/Photoshopv3/1.jpg', 'imgoverview/Photoshopv3/2.jpg', 'imgoverview/Photoshopv3/3.jpg', 'imgoverview/Photoshopv3/4.jpg', 'GM09 Photoshop Vol3.pdf'),
(11, 'GM-11', 'Autodesk Inventor', 'salah satu software design dan engineering yang membawa produksi melebihi digital prototyping untuk model 3D. perusahan machinery menggunakan inventor untuk mempercepat dan mengefektifkan rancangan serta proses engineering.', 55000, '-', 10, 57, 'gambarprodukbawah.png', '11inventor.png', '-', 'imgoverview/Inventor/1.jpg', 'imgoverview/Inventor/2.jpg', 'imgoverview/Inventor/3.jpg', 'imgoverview/Inventor/4.jpg', 'GM11 Autodesk Inventor.pdf'),
(12, 'GM-12', 'Photoshop Vol.4', 'Beragam Desain Pop art yang menarik akan anda temukan di Vulume 4 ini, mulai dari yang mudah hingga yang komplek. video tutorial ini menggunakan photoshop CS4 dan CS5 tetapi bisa diaplikasikan diversi lebih rendah.', 55000, '-', 10, 57, 'icon_produk_gm12.png', '12photoshopvol2.png', '-', 'imgoverview/Photoshopv4/1.jpg', 'imgoverview/Photoshopv4/2.jpg', 'imgoverview/Photoshopv4/3.jpg', 'imgoverview/Photoshopv4/4.jpg', 'GM12 Photoshop Vol4.pdf'),
(13, 'GM-13', 'AutoCAD 2D & 3D', 'AUTOCAD adalah salah satu software CAD yang berfungsi untuk menggambar 2 Dimensi dan 3 Dimensi untuk membangun Desain Architectural. Pada video tutorial kali ini membahas mulai dari pengenalan autocad dari tingkatan pemula sampai mahir.', 55000, '-', 10, 72, 'icon_produk_gm13.png', '13autocad 2d&3d.png', '', 'imgoverview/Autocad.2D.3D/1.jpg', 'imgoverview/Autocad.2D.3D/2.jpg', 'imgoverview/Autocad.2D.3D/3.jpg', 'imgoverview/Autocad.2D.3D/4.jpg', 'GM13 Autocad 2D&3D.pdf'),
(14, 'GM-14', 'Bank Soal CPNS', 'Sudahkan anda mempersiapkan diri untuk mengikuti tes CPNS dengan penuh persiaapan?<br />\r\nKeunggulan Software:<br />\r\nLembar jawaban interaktif, mengukur skore & passing grade, timer test, fitur menghafal jawaban & soal ', 50000, '-', 12, 57, 'produk_bank_soal_cpns.png', '14Banksoal.png', '-', 'imgoverview/BankSoal/1.jpg', 'imgoverview/BankSoal/2.jpg', 'imgoverview/BankSoal/3.jpg', 'imgoverview/BankSoal/4.jpg', 'GM14 Bank Soal CPNS.pdf'),
(16, 'GM-16', 'Visual Basic.Net', 'Visual Basic.NET merupakan lanjutan seri visual basic 6 dari Microsoft dan menjadi sebuah bahasa pemrograman yang sangat populer dewasa ini untuk digunakan membangun aplikasi dari aplikasi kecil – kecilan hingga skala enterprise.', 55000, '-', 10, 72, 'produk_vb_net.png', '16vb.png', '-', 'imgoverview/Visual.basic/1.jpg', 'imgoverview/Visual.basic/2.jpg', 'imgoverview/Visual.basic/3.jpg', 'imgoverview/Visual.basic/4.jpg', 'GM16 Visual Basic.pdf'),
(17, 'GM-17', 'Flash Gadget', 'Seri ke-2 Adobe Flash GarudaMedia Kini Memberikan ilmu tentang pemerograman berbasis Action Script yang bisa anda pelajari dengan mudah. Anda akan belajar membuat aplikasi-aplikasi berbasis logika pemrograman mulai dasar.', 55000, '', 12, 72, 'icon_produk_gm17.png', '17flash.png', '-', 'imgoverview/Flash.Gadget/1.jpg', 'imgoverview/Flash.Gadget/2.jpg', 'imgoverview/Flash.Gadget/3.jpg', 'imgoverview/Flash.Gadget/4.jpg', 'GM17 Flash Vol2.pdf'),
(15, 'GM-15', 'Sukses Tes Kerja', 'Membongkar trik cepat mengerjakan soal-soal tes kerja BUMN, SELEKSI CPNS, BANK, SWASTA dan lain-lain. Juga disertai trik menghadapi tes kesehatan, wawancara dan soal Try Out serta pembahasannya untuk persiapan Anda menghadapi situasi tes yang sebenarnya.', 50000, '-', 12, 57, 'produk_sukses_tes_kerja.png', '15lulus.png', '-', 'imgoverview/Sukses/1.jpg', 'imgoverview/Sukses/2.jpg', 'imgoverview/Sukses/3.jpg', 'imgoverview/Sukses/4.jpg', 'GM15 Sukses Tes Kerja.pdf'),
(18, 'GM-18', 'Wordpress', 'Tidak perlu menjadi seorang web developer yang ahli untuk membuat toko online dengan tampilan profesional. hanya dengan wordpress, sebuah content management system berbasis open sources, siapin dapat membuat toko online.', 50000, '', 12, 72, 'icon_produk_gm18.png', '18wordpress.png', '', 'imgoverview/Wordpress/1.jpg', 'imgoverview/Wordpress/2.jpg', 'imgoverview/Wordpress/3.jpg', 'imgoverview/Wordpress/4.jpg', 'GM18 Wordpress.pdf'),
(19, 'GM-19', '3Ds MAX Arsitektur', 'Jago berbagai teknik visualisasi modeling, lighting & rendering arsitektural. Temukan berbagai tutorial kreatif teknik modeling 3D Arsitektural.', 60000, '-', 12, 72, 'product_gm193dsmax.png', '193dsmax.png', '-', 'imgoverview/193dsmax/1.jpg', 'imgoverview/193dsmax/2.jpg', 'imgoverview/193dsmax/3.jpg', 'imgoverview/193dsmax/4.jpg', 'GM19-3dsmax-Arch.pdf'),
(20, 'GM-20', 'Aplikasi ArcGis 10', 'Pengenalan Dasar ArcGis 10 yang berisi pemahaman dasar dari aplikasi ArcGis 10 untuk keperluan analisis dalam dunia geospatial.', 100000, '-', 12, 72, 'product_gm20arcgis.png', '20arcgis.png', '-', 'imgoverview/20arcgis/1.jpg', 'imgoverview/20arcgis/2.jpg', 'imgoverview/20arcgis/3.jpg', 'imgoverview/20arcgis/4.jpg', 'GM20-ArcGis-10.pdf'),
(21, 'GM-21', '3DS Max Animation', 'Rahasia kreatif teknik animasi visualisasi 3D Arsitektural, serta tips trik dan cara instan animasi kamera (berputar, walkthrough, motion capture).', 60000, '-', 12, 72, 'product_213dsmaxanim.png', '213dsmaxanim.png', '-', 'imgoverview/213dsmaxanim/1.jpg', 'imgoverview/213dsmaxanim/2.jpg', 'imgoverview/213dsmaxanim/3.jpg', 'imgoverview/213dsmaxanim/4.jpg', 'GM-21-3dsMAX-Animation.pdf'),
(22, 'GM-22', 'Jago After Effect', 'Pengenalan 2D Compositing, 3D Compositing dan Motion Graphic. CD Tutorial ini menyediakan tutorial seputar After Effect yang mengupas tuntas tentang dunia spesial effect.', 60000, '-', 12, 72, 'product_22aftereffect.png', '22aftereffect.png', '-', 'imgoverview/22aftereffect/1.jpg', 'imgoverview/22aftereffect/2.jpg', 'imgoverview/22aftereffect/3.jpg', 'imgoverview/22aftereffect/4.jpg', 'GM-22-After-Effect.pdf'),
(26, 'GM-26', 'Staad Pro', 'Staad Pro merupakan software yang banyak digunakan oleh structural engineers untuk menganalisa dan merancang berbagai jenis permodelan struktur baja.', 100000, '-', 12, 72, 'product_26staadpro.png', '26staadpro.png', '-', 'imgoverview/26staadpro/1.jpg', 'imgoverview/26staadpro/2.jpg', 'imgoverview/26staadpro/3.jpg', 'imgoverview/26staadpro/4.jpg', 'GM-26-Staad_Pro.pdf'),
(23, 'GM-23', 'Power Point', 'CD Tutorial ini \r\nmembahas studi kasus membuat desain presentasi bertema edukasi, presentasi  bisnis & company \r\nprofile sehingga sangat tepat dipelajari siapa saja yang ingin membuat slide presentasi powerfull.', 80000, 'Power Point Animasi Interaktif', 6, 29, 'produkgm23powerpoint.png', '23powerpoint.png', '-', 'imgoverview/Power_Point/1.jpg', 'imgoverview/Power_Point/2.jpg', 'imgoverview/Power_Point/3.jpg', 'imgoverview/Power_Point/4.jpg', 'GM23_Power_Point.pdf'),
(24, 'GM-24', 'Microsoft Project', 'CD ini membahas Microsoft Project dengan pendekatan siklus proyek yang mencakup fase perencanaan, perkiraan, penjadwalan, pengorganisasian dan pengontrolan. Tool perencanaan dan pengelolaan proyek yang ada pada Microsoft Project dikupas tuntas per fase proyek. Tutorial dapat digunakan untuk versi Ms Project 2007, 2010, 2013 maupun versi lainnya.', 60000, 'Microsoft Project', 6, 6, 'produkgm24msproject.png', '24msproject.png', '-', 'imgoverview/Microsoft_Project/1.jpg', 'imgoverview/Microsoft_Project/2.jpg', 'imgoverview/Microsoft_Project/3.jpg', 'imgoverview/Microsoft_Project/4.jpg', 'GM24_Microsoft_Project.pdf'),
(25, 'GM-25', 'Web Programming Vol2', 'Pada CD Tutorial Web Programming(PHP) edisi kedua ini, lebih dari \r\n75 tutorial dengan durasi lebih dari 12 jam yang akan memandu Anda untuk mendalami tentang penggunaan PHP, teknik pemrograman object oriented, pembuatan aplikasi - aplikasi keren dengan menggunakan PHP seperti modul shopping cart lengkap dengan pembayaran dengan menggunakan paypal, video converter, modul hak akses, dan tentu saja pembangun aplikasi yang terintegrasi \r\ndengan situs - situs social media seperti facebook dan twitter.', 100000, 'Web Programming Volume 2', 6, 75, 'produkgm25webpro2.png', '25webprogram2.png', '-', 'imgoverview/Web_Programming2/1.jpg', 'imgoverview/Web_Programming2/2.jpg', 'imgoverview/Web_Programming2/3.jpg', 'imgoverview/Web_Programming2/4.jpg', 'GM25_Web_Programming.pdf'),
(29, 'GM-27', '3Ds Max & Vray', 'Temukan berbagai macam teknik rendering profesional arsitektur yang selama ini jarang diketahui dalam software 3DS Max & VRAY mulai dari modelling dasar sebuah bangunan, material shader, lighting, rendering hingga post production serta tips dan trik untuk mendapatkan hasil akhir eksekusi karya yang maksimal.', 100000, '-', 5, 25, 'product_gm273dsmax4.png', '273dsmax4.png', '-', 'imgoverview/273dsmax4/1.jpg', 'imgoverview/273dsmax4/2.jpg', 'imgoverview/273dsmax4/3.jpg', 'imgoverview/273dsmax4/4.jpg', 'GM27-3dsmax-Vray.pdf');
