INSERT INTO `seputar_garuda_online` (`id`, `judul`, `isi`, `link`) VALUES
(1, 'Pendahuluan (Getting Started)', '<p><b>Karisma Academy merupakan revolusi dalam belajar dengan sistem online.</b> Di Karisma Academy kamu bisa belajar apa aja secara online! Mulai dari pelajaran SD, SMP, SMA, termasuk persiapan untuk Ujian Nasional (UN) dan Seleksi Nasional Masuk Perguruan Tinggi Negeri (SNMPTN).</p><br />\r\n<br /><p>\r\nBelajar dengan Karisma Academy beda banget karena Karisma Academy udah melakukan riset selama bertaun-taun sampe sekarang untuk nemuin metode belajar yang paling efektif! Karisma Academy tidak hanya ngebantu kamu untuk ngerti pelajaran di sekolah, tapi juga dilatih untuk kreatif, berpikir dan bernalar dengan bener. Jadi kamu juga cerdas secara general dan IQ kamu bisa meningkat. Karisma Academy berusaha sebisa mungkin ngebuat kamu ngerti banget dengan cara yang FUN dan bikin kamu betah belajar.</p><br />\r\n<br /><p>\r\n<b>Beragam Pengetahuan dalam lebih dari 22.000 Video</b>\r\nAda ribuan video dengan beragam topik pengetahuan yang bisa kamu tonton di Karisma Academy. Lengkap dengan gambar dan animasi menarik serta cara pengajaran yang bakal bikin kamu ngerti banget. Kamu bisa menikmati video dengan total durasi lebih dari 1000 jam! Ditambah lagi setiap minggunya akan ada update video terbaru!</p><br />\r\n<br /><p>\r\nAkses Tanpa Batas Premium Member\r\nDengan menjadi Premium Member, kamu bisa nonton semua video yang ada di Karisma Academy, dapet update dan promo dari Karisma Academy, dan banyak informasi lainnya yang berguna banget buat kamu. Daftar jadi member Karisma Academy terus upgrade account kamu jadi Premium Member. Untuk penjelasan lebih lanjut bisa kamu liat di sini.</p><br />\r\n<br /><p>\r\n<b>A Passport to The World of Mind-Transforming Knowledge</b>\r\nGunakan voucher Karisma Academy untuk mendapatkan akses tanpa batas semua konten di Karisma Academy. Harga voucher Karisma Academy Rp 60.000 dan berlaku selama 30 hari penuh. Tunggu apa lagi?! Dapatkan voucher kamu sekarang juga dan akses semua konten di Karisma Academy.</p><br />\r\n<br /><p>\r\n<b>Ayo gabung sekarang juga dan dapatkan manfaat Karisma Academy !</b><br />\r\nGabung juga ke Karisma Club! Karisma Club merupakan suatu forum untuk kamu diskusi atau menanyakan hal-hal yang kamu gak ngerti. Di sini kamu bisa tanya-tanya langsung ke para tutor Karisma, saling berbagi ilmu, diskusi apa pun tentang ilmu pengetahuan bersama dengan zenius fellow lainnya, mengukur kemampuan diri kamu, dan pastinya ada juga update dari Karisma Academy.</p>\r\n<br /><br /><p>\r\nSelain itu gabung di fan page facebook  Karisma Multimedia Learning dan follow twitter @zeniuseducation untuk dapatkan beragam informasi dan update tentang Karisma. Misalkan kamu mau nonton video yang ada di Karisma Academy tanpa harus ada koneksi internet, kamu bisa juga gunakan Karisma Multimedia untuk ngebantu meningkatkan prestasi kamu.</p>', 'pendahuluan'),
(2, 'Aktivasi Voucher', 'Silahkan Login untuk mengaktifkan voucher Anda', 'aktivasi_voucher'),
(3, 'Beli Voucher', '<h2 style=''margin-left:0px;font-family:Arial,Verdana,Tahoma;''>Dapatkan Voucher Karisma Academy Sekarang Juga!</h2><br />\r\n<p>\r\nApa sih voucher zenius.net? Voucher zenius.net merupakan voucher yang digunakan untuk meng-upgrade account kamu menjadi Premium Member zenius.net dan kamu akan dapat mengakses semua konten yang ada di zenius.net.\r\n</p><br />\r\n<p>\r\nCaranya mudah lho! Pada voucher zenius.net terdapat kode unik yang disebut sebagai kode aktivasi. Nah, kamu cuma perlu aktifin voucher kamu dengan memasukkan kode tersebut di menu "Aktivasi Voucher". Setelah voucher kamu aktif, otomatis kamu menjadi Premium Member dan bisa mengakses semua konten zenius.net SEPUASNYA!\r\n</p><br />\r\n<p>\r\nHarganya cuma Rp 60.000 dan selama 30 hari penuh kamu akan bisa mengakses semua konten zenius net tanpa batas! Voucher zenius.net ngga ada EXPIRED DATE-nya dan bersifat akumulatif. Misalnya, kamu beli dua voucher sekaligus, maka otomatis kamu bisa langsung pake selama dua bulan. Begitupun kalau kamu beli tiga, maka bisa langsung untuk tiga bulan, dan seterusnya.\r\n</p><br />\r\n<p>\r\nAda dua jenis voucher zenius.net, elektrik dan voucher fisik. Untuk voucher elektrik zenius.net dilakukan pembelian secara online dengan melengkapi form di bawah ini.\r\n</p><br />\r\n<p>\r\n<ul style=''padding-left:20px;''>\r\n<li style=''list-style-type: square;''>Pembelian voucher zenius.net dilakukan secara online, kode aktivasi akan dikirimkan ke email kamu, sesuai dengan data pembelian.</li>\r\n<li style=''list-style-type: square;''>Pembayaran akan dilakukan dengan cara transfer ke rekening yang akan diberitahukan kemudian.</li>\r\n</ul>\r\n</p><br />', 'beli_voucher'),
(4, 'Tagihan Voucher', 'Ini adalah isi dari halaman tagihan voucher, nantinya halaman ini akan berisi tagihan voucher yang dipesan oleh user..', 'tagihan_voucher'),
(5, 'Outlet Voucher', 'Ini adalah halaman untuk menampilkan Daftar Outlet Voucher yang tersebar disetiap kota diseluruh indonesia', 'outlet_voucher'),
(6, 'Customer Services', 'Masih bingung atau ada pertanyaan lain terkait dengan zenius.net, seperti tentang voucher, keanggotaan, promosi, dan hal-hal lainnya atau ada saran serta kritik yang ingin disampaikan? Kamu bisa kontak langsung bagian customer service zenius.net melalui:<br /><br />Bicara langsung dengan customer service di nomor-nomor berikut ini: <br /><ul style=''margin-left:35px;''><li style=''list-style-type:square;''>CS#01 : 021-94219225</li><li style=''list-style-type:square;''>CS#02 : 021-96170109</li><li style=''list-style-type:square;''>CS#03 : 0858-83683449</li><li style=''list-style-type:square;''>CS#04 : 0813-83174800</li></ul><br /><br />\r\nPada hari Senin-Jumat, pukul 09:30-18:00, dan Sabtu, pukul 09:30-14:00.\r\nUntuk hari Minggu dan hari libur nasional, layanan customer service diliburkan.<br /><br />\r\n<b>Email</b><br />\r\nKirim email ke counterstrike@zoogeninsideus.network.', 'customer_services'),
(7, 'FAQ', '<b>Apa itu Karisma Academy?</b><br />\r\nKarisma Academy adalah website tempat kamu belajar apa pun secara online dalam bentuk video mulai dari pelajaran SD, SMP, SMA, termasuk persiapan untuk Ujian Nasional (UN), dan Seleksi Nasional Masuk Perguruan Tinggi Negeri (SNMPTN).<br /><br />\r\n\r\n<b>Gimana caranya nonton video di zenius.net?</b><br />\r\nUntuk nonton video kamu cuma perlu masuk ke halaman konten yang ingin kamu tonton. Pada setiap halaman akan terdapat playlist video yang bisa kamu pilih untuk kamu tonton. Ada beberapa halaman konten video yang cuma bisa diakses oleh member Karisma Academy.\r\n<br /><br />\r\n<b>Apa yang dimaksud dengan member di Karisma Academy?</b><br />\r\n    Member di Karisma Academy merupakan pengguna (user) yang telah terdaftar dan memiliki account di Karisma Academy. Member di zenius.net ada dua macam, yaitu Regular Member dan Premium Member, informasi lebih lengkapnya bisa kamu lihat di sini.<br /><br />\r\n<b>Gimana cara untuk menjadi member di Karisma Academy?</b>\r\n    Daftarkan diri kamu dengan mengisi formulir pendaftaran Karisma Academy. Untuk menjadi Premium Member, kamu cukup beli voucher Karisma Academy lalu aktifin deh kode aktivasi yang tertera pada voucher.<br /><br />\r\n<b>Apa yang dimaksud dengan voucher Karisma Academy?</b>\r\n    Voucher Karisma Academy merupakan voucher yang digunakan untuk meng-upgrade account kamu dari Regular Member menjadi Premium Member Karisma Academy dan kamu akan dapat mengakses semua konten yang ada di Karisma Academy.<br /><br />\r\n<b>Gimana cara mendapatkan voucher Karisma Academy?</b>\r\n    Pembelian voucher Karisma Academy dapat kamu lakukan langsung melalui website ini atau melalui outlet-outlet distributor Zenius Education. Untuk pembelian voucher elektrik melalui website zenius.net dapat melalui link pembelian voucher, sedangkan untuk lokasi pembelian voucher fisik dapat dilihat pada daftar outlet voucher.\r\n    Voucher elektrik merupakan voucher zenius.net yang akan dikirimkan ke email kamu yang berisi kode aktivasi, sedangkan voucher fisik merupakan voucher zenius.net dalam bentuk kartu.', 'FAQ');
